(238, 4, 15, 'CASQUE D''ÉCOUTE DE SÉRIE DE MONITEUR DE STUDIO SG-285', 27.4500000, 'Soyez à la une avec le casque d''écoute de série de moniteur de studio. Ce casque d''écoute haute performance de Sony propose une conception supra-auditive et douillette, des coussinets auriculaires à suppression du bruit pour un excellent confort d''écoute. Branchez-le à votre iPod, lecteur MP3, téléphone intelligent, ou PC et appréciez un divertissement audio supérieur par courtoisie des pilotes de 30 mm de diamètre de base et des aimants de ferrite haute énergie. Super pour l''usage portable, à la maison ou au studio. ', 'produits/4/(52).gif', '2011-09-19 14:48:38', 4, 0.9, '1'),
